import styled from 'styled-components'

const Header = () => {


    return (
    <HeaderContainer>
        <Logo src="images/Initspo-Min-Logo.png"></Logo>
    </HeaderContainer>

    )
}

const HeaderContainer = styled.div`
    height: 125px;
    position: relative;
    z-index: 2;
`

const Logo = styled.img`
    width: 100px
    position: absolute;
    bottom: -7px;
    left: 64px;

`

export default Header;
